<!DOCTYPE html>
<html lang="en" xmlns:th="http://www.thymeleaf.org">
<head>
    <meta charset="UTF-8"/>
    <meta name="viewport" content="width=device-width, initial-scale=1"/>
    <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=IBM+Plex+Sans:300,400,500&amp;subset=cyrillic&display=swap" media="screen">
    <style type="text/css">
        a {
            color: #6406FF;
            -webkit-text-fill-color: #6406FF;
            transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1) 0ms,box-shadow 250ms cubic-bezier(0.4, 0, 0.2, 1) 0ms;
        }
        .row {
            display: block;
            margin-bottom: 40px;
        }
        .text {
            font-size: 14px;
            line-height: 24px;
            font-weight: 500;
            letter-spacing: 0.75px;
            margin: 0;
            color: #FFF;
            -webkit-text-fill-color: #FFF;
        }
        .some {
            line-height: unset;
            letter-spacing: unset;
        }
        .instructions {
            font-weight: normal;
            font-size: 16px;
            letter-spacing: 0.15px;
        }
        .instructions:not(:last-of-type) {
            margin-bottom: 16px;
        }
        .button {
            box-sizing: border-box;
            text-decoration: none;
            transition: .2s;
            padding: 16px 40px;
            border-radius: 8px;
            background-image: linear-gradient(90deg, #FF2E6D -4%, #B51BB3 45%, #6405FF 99%);
        }
        .notice {
            border-collapse: collapse;
            border-radius: 4px;
            background-color: #262640;
            margin: 0 32px;
        }
        .comparisonColumn {
            display: inline-block;
            margin: 0 auto;
        }
        .comparisonList {
            font-weight: normal;
            letter-spacing: 0.15px;
            margin-bottom: 24px;
        }
        .comparisonList:first-of-type {
            margin-top: 47px;
        }
        .comparisonList:before {
            content: "";
            width: 4px;
            height: 4px;
            background: #8566FF;
            display: inline-block;
            border-radius: 100%;
            vertical-align: middle;
            margin-right: 10px;
        }
    </style>
</head>
